import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({ question,index, getQuestionId }){


    const quest = getQuestionId(question.id)
    return(

        <Paper
            key={index}
        >
            <h3>Category</h3>
            <p>{quest.category}</p>
        </Paper>
    )
}


export default Question;
